import React from 'react'
import './ProductPreview.scss'
import { Link } from 'react-router-dom'

export function ProductPreview(props) {
    const {name, _id} = props.product
    return (
        <div className="product-preview flex  align-center">
            <Link className="flex align-center" to={`/product/${_id}`}>
             <img width="100" height="100" src={`https://i.imgur.com/sl4f4Mr.jpg`} alt="img"></img>
             {name}
             </Link>
        </div>
    )
}
